var ghostMarker = L.geoJSON(ghost, {
    pointToLayer: function(feature, latlng) {
        var ghostIcon = L.icon({
            iconUrl: 'ghost.png',
            iconSize: [15, 15],
        });
        return L.marker(latlng, {icon: ghostIcon});
    },
    onEachFeature: function (feature, layer) {
        layer.bindPopup(`<b>Location of ghost haunting:</b> ${feature.properties.name}`)
        layer.on('click', function (e) {
            map.setView(e.latlng, 12)
         });
        
    }
}).addTo(map);

