var ufoMarker = L.geoJSON(ufo, {
    pointToLayer: function(feature, latlng) {
        var ufoIcon = L.icon({
            iconUrl: 'alien.png',
            iconSize: [10, 10],
        });
        return L.marker(latlng, {icon: ufoIcon});
    },
    onEachFeature: function (feature, layer) {
        layer.bindPopup(`<b>Type of UFO Sighting:</b> ${feature.properties.name}`)
        layer.on('click', function (e) {
            map.setView(e.latlng, 12)
         });
    }
}).addTo(map);

// create map layer group
var baseMaps = {
    "ArcGIS World Gray Canvas": canvasMap,
    "ArcGIS World Imagery": satMap,
    "ArcGIS World Topo": topoMap,
};

// create point layer groups
var overlayMaps = {
    "Bigfoot": bigfootMarker,
    "Ghosts": ghostMarker,
    "Aliens": ufoMarker,
};

var layerControl = L.control.layers(baseMaps, overlayMaps).addTo(map);

L.control.scale().addTo(map);
